doclet.description:
Fires when an area of the chart has been selected. Selection is
enabled by setting the chart's zoomType. One parameter, `event`, is
passed to the function, containing common event information. The
default action for the selection event is to zoom the chart to the
selected area. It can be prevented by calling
`event.preventDefault()` or return false.

Information on the selected area can be found through `event.xAxis`
and `event.yAxis`, which are arrays containing the axes of each
dimension and each axis' min and max values. The primary axes are
`event.xAxis[0]` and `event.yAxis[0]`. Remember the unit of a
datetime axis is milliseconds since 1970-01-01 00:00:00.

```js
selection: function(event) {
    // log the min and max of the primary, datetime x-axis
    console.log(
        Highcharts.dateFormat(
            '%Y-%m-%d %H:%M:%S',
            event.xAxis[0].min
        ),
        Highcharts.dateFormat(
            '%Y-%m-%d %H:%M:%S',
            event.xAxis[0].max
        )
    );
    // log the min and max of the y axis
    console.log(event.yAxis[0].min, event.yAxis[0].max);
}
```

Options for configuring markers for annotations.

An example of the arrow marker:
<pre>
{
  arrow: {
    id: 'arrow',
    tagName: 'marker',
    refY: 5,
    refX: 5,
    markerWidth: 10,
    markerHeight: 10,
    children: [{
      tagName: 'path',
      attrs: {
        d: 'M 0 0 L 10 5 L 0 10 Z',
        'stroke-width': 0
      }
    }]
  }
}
</pre>

Global options that don't apply to each chart. These options, like
the `lang` options, must be set using the `Highcharts.setOptions`
method.

```js
Highcharts.setOptions({
    global: {
        buttonTheme: {
            fill: '#d0d0d0'
        }
    }
});
```

An object containing language-related strings and settings. A typical setup
uses `Highcharts.setOptions` to make the options apply to all charts in the
same page.

```js
Highcharts.setOptions({
    lang: {
        locale: 'fr'
    }
});
```

Options for the navigator series. Available options are the same
as any series, documented at [plotOptions](#plotOptions.series)
and [series](#series).

Unless data is explicitly defined on navigator.series, the data
is borrowed from the first series in the chart.

Default series options for the navigator series are:
```js
series: {
    type: 'areaspline',
    fillOpacity: 0.05,
    dataGrouping: {
        smoothed: true
    },
    lineWidth: 1,
    marker: {
        enabled: false
    }
}
```

Options for the navigator X axis. Default series options for the
navigator xAxis are:
```js
xAxis: {
    tickWidth: 0,
    lineWidth: 0,
    gridLineWidth: 1,
    tickPixelInterval: 200,
    labels: {
           align: 'left',
        style: {
            color: '#888'
        },
        x: 3,
        y: -4
    }
}
```

Options for the navigator Y axis. Default series options for the
navigator yAxis are:
```js
yAxis: {
    gridLineWidth: 0,
    startOnTick: false,
    endOnTick: false,
    minPadding: 0.1,
    maxPadding: 0.1,
    labels: {
        enabled: false
    },
    title: {
        text: null
    },
    tickWidth: 0
}
```

A `gantt` series. If the [type](#series.gantt.type) option is not specified,
it is inherited from [chart.type](#chart.type).

Configuration options for the series are given in three levels:
1. Options for all series in a chart are defined in the
   [plotOptions.series](plotOptions.series) object.
2. Options for all `gantt` series are defined in
   [plotOptions.gantt](plotOptions.gantt).
3. Options for one single series are given in
   [the series instance array](series.gantt).

```
Highcharts.chart('container', {
    plotOptions: {
        series: {
            // general options for all series
        },
        gantt: {
            // shared options for all gantt series
        }
    },
    series: [{
        // specific options for this series instance
        type: 'gantt'
    }]
});
```

**TypeScript:**
- the [type](series.gantt.type) option must always be set.
- when accessing an array of series, the combined set of all series types is
  represented by [Highcharts.SeriesOptionsType
  ](/class-reference/Highcharts#.SeriesOptionsType). Narrowing down to the
  specific type can be done by checking the `type` property.

```
if (chart.options.series?.[0]?.type === gantt) {
    // code specific to the gantt series
}
```

